Gli arrondissement della Francia designano due tipologie di suddivisioni territoriali: 
* arrondissement dipartimentali, formati da più comuni all'interno di singoli dipartimenti; 
* arrondissement municipali, che costituiscono suddivisioni interne ad alcuni grandi comuni. In ogni caso, gli arrondissement, o circondari, non costituiscono un ente territoriale dotato di personalità giuridica, ma rappresentano soltanto una forma organizzativa tra comuni o interna ai comuni medesimi, tipica dei Paesi francofoni.

